			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n# Name of the resource we're selectively copying\nGOOGLESERVICE_INFO_PLIST=GoogleService-Info.plist\n\n# Get references to dev and prod versions of the GoogleService-Info.plist\n# NOTE: These should only live on the file system and should NOT be part of the target (since we'll be adding them to the target manually)\nGOOGLESERVICE_INFO_SAFARNAMA=${PROJECT_DIR}/${TARGET_NAME}/Firebase/Safarnama/${GOOGLESERVICE_INFO_PLIST}\nGOOGLESERVICE_INFO_PPP=${PROJECT_DIR}/${TARGET_NAME}/Firebase/PPP/${GOOGLESERVICE_INFO_PLIST}\n\n# Make sure the Safarnama version of GoogleService-Info.plist exists\necho \"Looking for ${GOOGLESERVICE_INFO_PLIST} in ${GOOGLESERVICE_INFO_SAFARNAMA}\"\nif [ ! -f $GOOGLESERVICE_INFO_SAFARNAMA ]\nthen\n    echo \"No Safarnama GoogleService-Info.plist found. Please ensure it's in the proper directory.\"\n    exit 1\nfi\n\n# Make sure the PPP version of GoogleService-Info.plist exists\necho \"Looking for ${GOOGLESERVICE_INFO_PLIST} in ${GOOGLESERVICE_INFO_PPP}\"\nif [ ! -f $GOOGLESERVICE_INFO_PPP ]\nthen\n    echo \"No PPP GoogleService-Info.plist found. Please ensure it's in the proper directory.\"\n    exit 1\nfi\n\n# Get a reference to the destination location for the GoogleService-Info.plist\nPLIST_DESTINATION=${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app\necho \"Will copy ${GOOGLESERVICE_INFO_PLIST} to final destination: ${PLIST_DESTINATION}\"\n\n# Copy over the prod GoogleService-Info.plist for PPP builds\nif [ \"${CONFIGURATION}\" == \"Release - Ports Past and Present\" ]\nthen\n    echo \"Using ${GOOGLESERVICE_INFO_PPP}\"\n    cp \"${GOOGLESERVICE_INFO_PPP}\" \"${PLIST_DESTINATION}\"\nelse\n    echo \"Using ${GOOGLESERVICE_INFO_SAFARNAMA}\"\n    cp \"${GOOGLESERVICE_INFO_SAFARNAMA}\" \"${PLIST_DESTINATION}\"\nfi\n";
